const Users=(props)=>{
    console.log('Users',props)
    return(
        <div>
        <h1>Users</h1>
    <ul>
        {
        props.users.map((user,index)=>{
            return(
                <div key={index}>
                    <li>{user.name}</li>
                </div>
            )
        })
    }
    </ul>
    </div>
    );

}

export default Users
